<!doctype html><html lang="en"><head><meta charset="utf-8"/><link rel="icon" href="/first-web-app/favicon.ico"/><meta name="viewport" content="width=device-width,initial-scale=1"/><meta name="theme-color" content="#000000"/><meta name="description" content="Web site created using create-react-app"/><link rel="apple-touch-icon" href="/first-web-app/logo192.png"/><link rel="manifest" href="/first-web-app/manifest.json"/><link rel="stylesheet" href="index.css"/><title>React App</title><script defer="defer" src="/first-web-app/static/js/main.267e39d0.js"></script><link href="/first-web-app/static/css/main.9b2330e9.css" rel="stylesheet"></head><body><div id="errors" style="background:#c00;color:#fff;display:none;margin:-20px -20px 20px;padding:20px;white-space:pre-wrap"></div><div id="root"></div><script src="../src/index.js" type="text/jsx">window.addEventListener('mousedown', function(e) {
    document.body.classList.add('mouse-navigation');
    document.body.classList.remove('kbd-navigation');
  });
  window.addEventListener('keydown', function(e) {
    if (e.keyCode === 9) {
      document.body.classList.add('kbd-navigation');
      document.body.classList.remove('mouse-navigation');
    }
  });
  window.addEventListener('click', function(e) {
    if (e.target.tagName === 'A' && e.target.getAttribute('href') === '#') {
      e.preventDefault();
    }
  });
  window.onerror = function(message, source, line, col, error) {
    var text = error ? error.stack || error : message + ' (at ' + source + ':' + line + ':' + col + ')';
    errors.textContent += text + '\n';
    errors.style.display = '';
  };
  console.error = (function(old) {
    return function error() {
      errors.textContent += Array.prototype.slice.call(arguments).join(' ') + '\n';
      errors.style.display = '';
      old.apply(this, arguments);
    }
  })(console.error);</script></body></html>
